import torch
import torch.nn as nn

from typing import *
from dataclasses import dataclass
from scipy.linalg import hadamard
from compressor.utils import PersistentHook

__all__ = [
    "HadamardMatrix",
    "HadamardInputHook",
    "get_rotation_matrix",
    "hadamard_in",
    "hadamard_transform"
]

@dataclass
class HadamardInputHook(PersistentHook):
    """
    Forward pre hook for Hadamard transformation on down_proj input
    """
    rhs: torch.Tensor
    lhs: torch.Tensor
    k: int

    def process(self, x: torch.Tensor):
        return hadamard_transform(
            x.to(dtype=self.rhs.dtype),
            self.rhs.to(x.device),
            self.lhs.to(x.device),
            self.k,
            scaled=True
        ).to(x.dtype)

def get_rotation_matrix(num_channels: int, random: bool = False):
    """
    Get a rotation matrix for the given number of channels
    """
    if random:
        # create random diagonal matrix
        Q = torch.randint(low=0, high=2, size=(num_channels,)).to(torch.float64)
        Q = Q * 2 - 1
        Q = torch.diag(Q)

        # get lhs matrix
        lhs, k = HadamardMatrix.get_lhs(num_channels)

        # reshape: (B, C, 1)
        inp = Q.clone().view(-1, Q.shape[-1], 1)
        out = inp.clone()

        # compute random hadamard matrix
        while inp.shape[1] > k:
            # reshape: (B, C // 2, 2, 1)
            inp = inp.view(inp.shape[0], inp.shape[1] // 2, 2, inp.shape[2])
            out = out.view(inp.shape)

            # butterfly operation
            out[:, :, 0, :] = inp[:, :, 0, :] + inp[:, :, 1, :]
            out[:, :, 1, :] = inp[:, :, 0, :] - inp[:, :, 1, :]

            # reshape: (B, C // 2, 1)
            out = out.view(inp.shape[0], inp.shape[1], -1)
            inp, out = out, inp
        del out

        # apply remaining k
        if k > 1:
            inp = lhs.view(1, k, k).to(inp) @ inp
        rotation = inp.view(Q.shape)
    
    else:
        # get pre-computed lhs, rhs matrix
        rhs, lhs, k = HadamardMatrix.get(num_channels, scale=False)
        rhs = rhs.to(dtype=torch.float64)

        # compute full hadamard matrix
        if k == 1:
            rotation = rhs
        else:
            lhs = lhs.T.contiguous().to(dtype=torch.float64)
            rotation = torch.kron(lhs, rhs)
    
    # normalize
    rotation.mul_(1.0 / torch.tensor(num_channels, dtype=torch.float64).sqrt())
    return rotation

def hadamard_transform(
    x: torch.Tensor,
    rhs: torch.Tensor,
    lhs: torch.Tensor | None,
    k: int,
    scaled: bool = False
):
    """
    Apply Hadamard transform to the input x
    """
    shape = x.shape
    n = shape[-1]
    
    # reshpae: (B, k, n // k)
    x = x.view(-1, k, n // k)

    # apply rhs matrix
    x = x @ rhs
    if not scaled:
        x = x.mul_(
            (1.0 / torch.tensor(n, dtype=torch.float64).sqrt())
            .to(device=x.device, dtype=x.dtype)
        )
    
    # apply lhs matrix
    if k > 1:
        x = lhs @ x
    
    return x.view(shape)

def hadamard_in(
    module: nn.Linear,
    dtype: torch.dtype | None = None,
    device: torch.device | str | None = None,
):
    """
    Apply Hadamard transform to the input channels
    """
    in_channels = module.in_features
    device = device or module.weight.device
    dtype = dtype or module.weight.dtype

    # get hadamard matrix (float64 for weight transform)
    rhs, lhs, k = HadamardMatrix.get(in_channels, scale=True, dtype=torch.float64)

    # in-place transform to module's weight
    module.weight.data = hadamard_transform(
        module.weight.data.to(torch.float64),
        rhs.to(device),
        lhs.to(device),
        k,
        scaled=True
    ).to(device=device, dtype=module.weight.dtype)

    # return hadamard matrices for runtime hook
    return HadamardMatrix.get(in_channels, scale=True, dtype=dtype, device=device)
    

def is_pow2(n: int):
    """
    Check if n is a power of 2
    """
    return n > 0 and (n & (n - 1)) == 0

class HadamardMatrix:
    """
    Hadamard matrix cache and utilities
    """
    _cache: Dict[Tuple, Tuple] = {}
    _allowed_dims = [172, 156, 140, 108, 60, 52, 36, 28, 40, 20, 12]

    @staticmethod
    def get(
        n: int, 
        scale: bool, 
        dtype: torch.dtype = torch.float32, 
        device: torch.device | str = "cpu"
    ):
        """
        Get the hadamard matrix components
        """
        if isinstance(device, str):
            device = torch.device(device)
        key = (n, scale, dtype, device)

        # create hadamard matrix
        if key not in HadamardMatrix._cache:
            # get lhs matrix
            lhs, k = HadamardMatrix.get_lhs(n)

            # create rhs matrix
            rhs = torch.FloatTensor(hadamard(n // k))
            if scale:
                den = torch.tensor(n, dtype=torch.float64).sqrt_()
                rhs = rhs.to(dtype=torch.float64).mul_(1.0 / den)

            # move to correct device & dtype
            lhs = lhs.to(dtype=dtype, device=device)
            rhs = rhs.to(dtype=dtype, device=device)

            # caching
            HadamardMatrix._cache[key] = rhs, lhs, k

        return HadamardMatrix._cache[key]

    @staticmethod
    def get_lhs(n: int):
        """
        Get the left-hand-side Hadamard matrix
        to support dimensions which are not power of 2
        """
        # dimensions which are not power of 2
        for k in HadamardMatrix._allowed_dims:
            if n % k == 0:
                assert is_pow2(n // k)
                return HadamardMatrix._get_hadamard_k(k), k

        # dimensions which are power of 2
        assert is_pow2(n)
        return torch.FloatTensor([1]), 1

    def _get_hadamard_k(k: int):
        if is_pow2(k):
            return torch.FloatTensor(hadamard(k))
        else:
            return getattr(HadamardMatrix, f"_get_hadamard_{k}")()

